import React from 'react'
import Button from 'react-bootstrap/Button'

function Creditlinks() {
    return (
        <>
       <Button >Atlassin</Button>{'   '}
       <Button variant="outline-primary">Datalog</Button>{'   '}
       <Button variant="outline-primary">MacCloud</Button>{'   '}
       <Button variant="outline-primary">PagerDuty</Button>{'   '}
       <Button variant="outline-primary">Sentry</Button>{'   '}
       <Button variant="outline-primary">Xmission</Button>{'   '}
       <Button variant="outline-primary">Tsinghua University </Button>{'   '}
       <Button variant="outline-primary">Fastly </Button>{'   '}
       <Button variant="outline-primary">SpinUp </Button>{' '}
       <Button variant="outline-primary">IBM</Button>{' '}
    
      </>
    )
}

export default Creditlinks
